NO_CHANGE = [
  'lopez@foreignbanks.ch',
  'maurer@foreignbanks.ch',
  'robert@redo2oo.ch',
]

# this is a method, we pass the calling instance
# as first parameter. like this we have access on all its attributes
def run(self, **kw_args):
    odoo = self.get_odoo()
    partners = odoo.env['res.partner']
    counter = 0
    for ps in partners.search([]):
        partner = partners.browse(ps)
        if partner.is_company:
            #print 'c', partner.company_type
            if partner.image != COMPANY:
                print(partner.name,partner.street, end=' ')
                if partner.image == AVATAR:
                    print('ist avatar')
                else:
                    print('not avatar not company')
                partner.write({'image' : COMPANY})
